import React from 'react';

const App = () => {
    return(
        <>
            <div className='bg'>
                <div className='card'>
                    <h1>ToDo List</h1>

                    <input type='text' placeholder='Enter Items to add' />
                    

                    <ol>
                        <li>Apple</li>
                    </ol>
                </div>
            </div>
        </>
    );
}

export default App;
